import React, { Component } from 'react'

export class RegisterSuccess extends Component {
    render() {
        return (
            <div className="mt-5 text-center">
                Your Registration is successful. An Email verification has been sent to your email. Click on the link to complete your verification.
            </div>
        )
    }
}

export default RegisterSuccess
